@media all and (max-width: 1200px) {
  #sidebar {
    position: fixed;
    top: 40px;
    right: 0;
    transform: translateX(100%);
    transition: all 400ms ease;
    z-index: 2;
  }
  #sidebar.open {
    transform: translateX(0);
  }
  #sidebar.open .sidebar-menu {
    height: 100vh;
    width: 300px;
    right: 0;
    border-right: none;
  }

  .sidebar-toggle {
    position: fixed;
    display: flex;
    left: 0;
    right: 0;
    width: 100%;
    height: 40px;
    align-items: center;
    justify-content: left;
    background: #eee;
    z-index: 2;
    transition: background 300ms ease;
    cursor: pointer;
  }
  .sidebar-toggle:hover {
    background: #f6f6f6;
  }
  .swagger-ui.has-sidebar {
    margin-top: 40px;
  }
  .sidebar-toggle > p {
    margin: 0 32px;
  }
}

@media all and (min-width: 1201px) {
  .sidebar-toggle {
    display: none;
  }
  .overlay.on {
    display: none;
  }
  .swagger-ui {
    margin-top: 0;
  }
  .swagger-ui.has-sidebar {
    margin-left: 260px;
  }
}

