}

.swagger-ui .try-out .btn.cancel {
  color: var(--red-600);
  border-color: var(--red-600);
}

.swagger-ui .btn.execute {
  background-color: var(--blue-500);
}

.swagger-ui .opblock-body .execute-wrapper {
  /* grid-row-start: 3; */
  -ms-grid-row: 3;
  grid-column-start: 1;
  -ms-grid-column: 1;
  padding-top: 16px;
  padding-right: 0;
  padding-left: 13em;
}

@media (max-width: 768px) {
  .swagger-ui .opblock-body .btn-group,
  .swagger-ui .opblock-body .execute-wrapper {
    padding-left: 0;
  }
}

.swagger-ui .opblock-section {
  grid-column-start: 1;
  -ms-grid-column: 1;
  /* having this grid row seems to make it stack in some specs  */
  /* grid-row-start: 2; */
  -ms-grid-row: 2;
}

.swagger-ui .loading-container {
  grid-column-start: 1;
  grid-row-start: 3;
  -ms-grid-column: 1;
  -ms-grid-row: 4;
  word-break: normal;
}

.swagger-ui .right-side-wrapper {
  grid-column-start: 2;
  grid-row-start: 1;
  grid-row-end: 5;

  -ms-grid-column: 3;
  -ms-grid-row: 1;
  -ms-grid-row-span: 4;
}

.swagger-ui .opblock-body {
  width: 100%
}


/* code snippets */
.swagger-ui .code-snippet {
  margin: 0 0 34px 0;
  position: relative;
}

.swagger-ui .code-snippet .overlay{
  position: absolute;
  flex-direction: column;
  justify-content: center;
  background-color:rgba(255, 255, 255, 0.80);
  z-index: 0;
}

.swagger-ui .code-snippet .overlay.on{
  display: flex
}

.swagger-ui .code-snippet .overlay .close{
  color:rgba(0, 0, 0, 1);
  cursor: pointer;
  position: absolute;
  top: 25%;
  right: 0%;
  padding: 12px 16px;
  transform: translate(0%, -50%);
}

.swagger-ui .code-snippet .overlay .close:hover{
  color:rgba(0, 0, 0, 0.5);
}


.swagger-ui .code-snippet .overlay p {
  text-align: center;
  margin: 30px;
  font-size: 1.17em;
  font-weight: bold;
  color: rgb(59, 65, 81);
}


.swagger-ui .code-snippet .tabs-component ul{
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  min-height: 30px;
  border-radius: 3px 0px 0px;
  background-color: rgb(0, 48, 82);
  list-style: none;
  padding: 0;
  margin: 0;
}
.swagger-ui .code-snippet .tabs-component li{
  line-height: 2.5;
  display: inline;
  margin: 0 5px 0 0;
}

.swagger-ui .code-snippet .tabs-component a {
  color: rgb(255, 255, 255);
  font-size: 14px;
  font-weight: normal;
}

.swagger-ui .code-snippet .tabs-component .is-active a {
  color: rgb(255, 255, 255);
  font-size: 14px;
  font-weight: 800;
}

.swagger-ui .code-snippet .tabs-component-panels > section > pre {
  border-radius: 0 0 3px;
  background-color: rgb(0, 36, 61);
  overflow-x: auto;
}

.swagger-ui .code-snippet .tabs-component-panels > section > pre span :before {
  counter-increment: line;
  content: counter(line);
  display: inline-block;
  border-right: 1px solid #ddd;
  padding: 0 .5em;
  margin-right: .5em;
  color: #888
}

.swagger-ui .parameters-col_description > select {
  height: unset;
}


